import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './views/home.js'
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/home" component={Home}>
          </Route>
        </Switch>
      </Router>
      <h1>Hello World</h1>
      <link></link>
    </div>
  );
}

export default App;
